INSERT INTO `email_template` VALUES (1,'User Invite Default','Email sent to invite new users to your DreamFactory instance.',NULL,NULL,NULL,'[DF] New User Invitation',NULL,'<div style=\"padding: 10px;\">\n                                <p>\n                                Hi {first_name},\n                                </p>\n                                <p>\n                                    You have been invited to the DreamFactory Instance of {instance_name}. Go to the following url, enter the code below, and set\n                                    your password to confirm your account.\n                                    <br/>\n                                    <br/>\n                                    {link}\n                                    <br/>\n                                    <br/>\n                                    Confirmation Code: {confirm_code}<br/>\n                                </p>\n                                <p>\n                                    <cite>-- The Dream Team</cite>\n                                </p>\n                              </div>','DO NOT REPLY','no-reply@dreamfactory.com',NULL,NULL,NULL,'2016-08-11 08:07:22','2016-08-11 08:07:22',NULL,NULL),(2,'User Registration Default','Email sent to new users to complete registration.',NULL,NULL,NULL,'[DF] Registration Confirmation',NULL,'<div style=\"padding: 10px;\">\n                                <p>\n                                    Hi {first_name},\n                                </p>\n                                <p>\n                                    You have registered an user account on the DreamFactory instance of {instance_name}. Go to the following url, enter the\n                                    code below, and set your password to confirm your account.\n                                    <br/>\n                                    <br/>\n                                    {link}\n                                    <br/>\n                                    <br/>\n                                    Confirmation Code: {confirm_code}\n                                    <br/>\n                                </p>\n                                <p>\n                                    <cite>-- The Dream Team</cite>\n                                </p>\n                            </div>','DO NOT REPLY','no-reply@dreamfactory.com',NULL,NULL,NULL,'2016-08-11 08:07:22','2016-08-11 08:07:22',NULL,NULL),(3,'Password Reset Default','Email sent to users following a request to reset their password.',NULL,NULL,NULL,'[DF] Password Reset',NULL,'<div style=\"padding: 10px;\">\n                                <p>\n                                    Hi {first_name},\n                                </p>\n                                <p>\n                                    You have requested to reset your password. Go to the following url, enter the code below, and set your new password.\n                                    <br>\n                                    <br>\n                                    {link}\n                                    <br>\n                                    <br>\n                                    Confirmation Code: {confirm_code}\n                                </p>\n                                <p>\n                                    <cite>-- The Dream Team</cite>\n                                </p>\n                            </div>','DO NOT REPLY','no-reply@dreamfactory.com',NULL,NULL,NULL,'2016-08-11 08:07:22','2016-08-11 08:07:22',NULL,NULL),(4,'AIrlink U Restablecer Contrase√±a','Plantilla de restablecimiento de contrase√±a para Airlink U',NULL,NULL,NULL,'AirlinkU: Restablecer contrase√±a',NULL,'<div style=\"padding: 10px;\">\n    <p>\n        Hola {first_name},\n    </p>\n    <p>\n        Has solicitado restablecer tu contrase√±a. Accede a la siguiente direcci√≥n, ingresa el c√≥digo suministrado y escribe tu nueva contrase√±a.\n    </p>\n    <p>\n        <a href=\"http://app.airlinku.com/restablecer/{confirm_code}\">\n            http://app.airlinku.com/restablecer/{confirm_code}\n        </a>\n    </p>\n    <br /> \n    <p>\n        C√≥digo de confirmaci√≥n: {confirm_code}\n    </p>\n</div>','Airlink U','noreply@mail.airlinku.com','Airlink U','info@airlinku.com',NULL,'2017-08-08 15:55:59','2017-08-08 14:55:59',1,1),(5,'AirlinkU Confirmar Usuario','Confirma la cuenta de un usuario',NULL,NULL,NULL,'Activar cuenta',NULL,'<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n	<head>\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\n        <title>*|MC:SUBJECT|*</title>\n        <style type=\"text/css\">\n			/* /\\/\\/\\/\\/\\/\\/\\/\\/ CLIENT-SPECIFIC STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\n			#outlook a{padding:0;} /* Force Outlook to provide a \"view in browser\" message */\n			.ReadMsgBody{width:100%;} .ExternalClass{width:100%;} /* Force Hotmail to display emails at full width */\n			.ExternalClass, .ExternalClass p, .ExternalClass span, .ExternalClass font, .ExternalClass td, .ExternalClass div {line-height: 100%;} /* Force Hotmail to display normal line spacing */\n			body, table, td, p, a, li, blockquote{-webkit-text-size-adjust:100%; -ms-text-size-adjust:100%;} /* Prevent WebKit and Windows mobile changing default text sizes */\n			table, td{mso-table-lspace:0pt; mso-table-rspace:0pt;} /* Remove spacing between tables in Outlook 2007 and up */\n			img{-ms-interpolation-mode:bicubic;} /* Allow smoother rendering of resized image in Internet Explorer */\n			/* /\\/\\/\\/\\/\\/\\/\\/\\/ RESET STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\n			body{margin:0; padding:0;}\n			img{border:0; height:auto; line-height:100%; outline:none; text-decoration:none;}\n			table{border-collapse:collapse !important;}\n			body, #bodyTable, #bodyCell{height:100% !important; margin:0; padding:0; width:100% !important;}\n			/* /\\/\\/\\/\\/\\/\\/\\/\\/ TEMPLATE STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\n			/* ========== Page Styles ========== */\n			#bodyCell{padding:20px;}\n			#templateContainer{width:600px;}\n			/**\n			* @tab Page\n			* @section background style\n			* @tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\n			* @theme page\n			*/\n			body, #bodyTable{\n				/*@editable*/ background-color:#DEE0E2;\n			}\n			/**\n			* @tab Page\n			* @section background style\n			* @tip Set the background color and top border for your email. You may want to choose colors that match your company\'s branding.\n			* @theme page\n			*/\n			#bodyCell{\n				/*@editable*/ border-top:4px solid #BBBBBB;\n			}\n			/**\n			* @tab Page\n			* @section email border\n			* @tip Set the border for your email.\n			*/\n			#templateContainer{\n				/*@editable*/ border:1px solid #BBBBBB;\n			}\n			/**\n			* @tab Page\n			* @section heading 1\n			* @tip Set the styling for all first-level headings in your emails. These should be the largest of your headings.\n			* @style heading 1\n			*/\n			h1{\n				/*@editable*/ color:#202020 !important;\n				display:block;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:26px;\n				/*@editable*/ font-style:normal;\n				/*@editable*/ font-weight:bold;\n				/*@editable*/ line-height:100%;\n				/*@editable*/ letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Page\n			* @section heading 2\n			* @tip Set the styling for all second-level headings in your emails.\n			* @style heading 2\n			*/\n			h2{\n				/*@editable*/ color:#404040 !important;\n				display:block;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:20px;\n				/*@editable*/ font-style:normal;\n				/*@editable*/ font-weight:bold;\n				/*@editable*/ line-height:100%;\n				/*@editable*/ letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Page\n			* @section heading 3\n			* @tip Set the styling for all third-level headings in your emails.\n			* @style heading 3\n			*/\n			h3{\n				/*@editable*/ color:#606060 !important;\n				display:block;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:16px;\n				/*@editable*/ font-style:italic;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ line-height:100%;\n				/*@editable*/ letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Page\n			* @section heading 4\n			* @tip Set the styling for all fourth-level headings in your emails. These should be the smallest of your headings.\n			* @style heading 4\n			*/\n			h4{\n				/*@editable*/ color:#808080 !important;\n				display:block;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:14px;\n				/*@editable*/ font-style:italic;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ line-height:100%;\n				/*@editable*/ letter-spacing:normal;\n				margin-top:0;\n				margin-right:0;\n				margin-bottom:10px;\n				margin-left:0;\n				/*@editable*/ text-align:left;\n			}\n			/* ========== Header Styles ========== */\n			/**\n			* @tab Header\n			* @section preheader style\n			* @tip Set the background color and bottom border for your email\'s preheader area.\n			* @theme header\n			*/\n			#templatePreheader{\n				/*@editable*/ background-color:#F4F4F4;\n				/*@editable*/ border-bottom:1px solid #CCCCCC;\n			}\n			/**\n			* @tab Header\n			* @section preheader text\n			* @tip Set the styling for your email\'s preheader text. Choose a size and color that is easy to read.\n			*/\n			.preheaderContent{\n				/*@editable*/ color:#808080;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:10px;\n				/*@editable*/ line-height:125%;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Header\n			* @section preheader link\n			* @tip Set the styling for your email\'s preheader links. Choose a color that helps them stand out from your text.\n			*/\n			.preheaderContent a:link, .preheaderContent a:visited, /* Yahoo! Mail Override */ .preheaderContent a .yshortcuts /* Yahoo! Mail Override */{\n				/*@editable*/ color:#606060;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ text-decoration:underline;\n			}\n			/**\n			* @tab Header\n			* @section header style\n			* @tip Set the background color and borders for your email\'s header area.\n			* @theme header\n			*/\n			#templateHeader{\n				/*@editable*/ background-color:#F4F4F4;\n				/*@editable*/ border-top:1px solid #FFFFFF;\n				/*@editable*/ border-bottom:1px solid #CCCCCC;\n			}\n			/**\n			* @tab Header\n			* @section header text\n			* @tip Set the styling for your email\'s header text. Choose a size and color that is easy to read.\n			*/\n			.headerContent{\n				/*@editable*/ color:#505050;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:20px;\n				/*@editable*/ font-weight:bold;\n				/*@editable*/ line-height:100%;\n				/*@editable*/ padding-top:0;\n				/*@editable*/ padding-right:0;\n				/*@editable*/ padding-bottom:0;\n				/*@editable*/ padding-left:0;\n				/*@editable*/ text-align:left;\n				/*@editable*/ vertical-align:middle;\n			}\n			/**\n			* @tab Header\n			* @section header link\n			* @tip Set the styling for your email\'s header links. Choose a color that helps them stand out from your text.\n			*/\n			.headerContent a:link, .headerContent a:visited, /* Yahoo! Mail Override */ .headerContent a .yshortcuts /* Yahoo! Mail Override */{\n				/*@editable*/ color:#EB4102;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ text-decoration:underline;\n			}\n			#headerImage{\n				height:auto;\n				max-width:600px;\n			}\n			/* ========== Body Styles ========== */\n			/**\n			* @tab Body\n			* @section body style\n			* @tip Set the background color and borders for your email\'s body area.\n			*/\n			#templateBody{\n				/*@editable*/ background-color:#F4F4F4;\n				/*@editable*/ border-top:1px solid #FFFFFF;\n				/*@editable*/ border-bottom:1px solid #CCCCCC;\n			}\n			/**\n			* @tab Body\n			* @section body text\n			* @tip Set the styling for your email\'s main content text. Choose a size and color that is easy to read.\n			* @theme main\n			*/\n			.bodyContent{\n				/*@editable*/ color:#505050;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:14px;\n				/*@editable*/ line-height:150%;\n				padding-top:20px;\n				padding-right:20px;\n				padding-bottom:20px;\n				padding-left:20px;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Body\n			* @section body link\n			* @tip Set the styling for your email\'s main content links. Choose a color that helps them stand out from your text.\n			*/\n			.bodyContent a:link, .bodyContent a:visited, /* Yahoo! Mail Override */ .bodyContent a .yshortcuts /* Yahoo! Mail Override */{\n				/*@editable*/ color:#EB4102;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ text-decoration:underline;\n			}\n			.bodyContent img{\n				display:inline;\n				height:auto;\n				max-width:560px;\n			}\n			/* ========== Footer Styles ========== */\n			/**\n			* @tab Footer\n			* @section footer style\n			* @tip Set the background color and borders for your email\'s footer area.\n			* @theme footer\n			*/\n			#templateFooter{\n				/*@editable*/ background-color:#F4F4F4;\n				/*@editable*/ border-top:1px solid #FFFFFF;\n			}\n			/**\n			* @tab Footer\n			* @section footer text\n			* @tip Set the styling for your email\'s footer text. Choose a size and color that is easy to read.\n			* @theme footer\n			*/\n			.footerContent{\n				/*@editable*/ color:#808080;\n				/*@editable*/ font-family:Helvetica;\n				/*@editable*/ font-size:10px;\n				/*@editable*/ line-height:150%;\n				padding-top:20px;\n				padding-right:20px;\n				padding-bottom:20px;\n				padding-left:20px;\n				/*@editable*/ text-align:left;\n			}\n			/**\n			* @tab Footer\n			* @section footer link\n			* @tip Set the styling for your email\'s footer links. Choose a color that helps them stand out from your text.\n			*/\n			.footerContent a:link, .footerContent a:visited, /* Yahoo! Mail Override */ .footerContent a .yshortcuts, .footerContent a span /* Yahoo! Mail Override */{\n				/*@editable*/ color:#606060;\n				/*@editable*/ font-weight:normal;\n				/*@editable*/ text-decoration:underline;\n			}\n			/* /\\/\\/\\/\\/\\/\\/\\/\\/ MOBILE STYLES /\\/\\/\\/\\/\\/\\/\\/\\/ */\n            @media only screen and (max-width: 480px){\n				/* /\\/\\/\\/\\/\\/\\/ CLIENT-SPECIFIC MOBILE STYLES /\\/\\/\\/\\/\\/\\/ */\n				body, table, td, p, a, li, blockquote{-webkit-text-size-adjust:none !important;} /* Prevent Webkit platforms from changing default text sizes */\n                body{width:100% !important; min-width:100% !important;} /* Prevent iOS Mail from adding padding to the body */\n				/* /\\/\\/\\/\\/\\/\\/ MOBILE RESET STYLES /\\/\\/\\/\\/\\/\\/ */\n				#bodyCell{padding:10px !important;}\n				/* /\\/\\/\\/\\/\\/\\/ MOBILE TEMPLATE STYLES /\\/\\/\\/\\/\\/\\/ */\n				/* ======== Page Styles ======== */\n				/**\n				* @tab Mobile Styles\n				* @section template width\n				* @tip Make the template fluid for portrait or landscape view adaptability. If a fluid layout doesn\'t work for you, set the width to 300px instead.\n				*/\n				#templateContainer{\n					max-width:600px !important;\n					/*@editable*/ width:100% !important;\n				}\n				/**\n				* @tab Mobile Styles\n				* @section heading 1\n				* @tip Make the first-level headings larger in size for better readability on small screens.\n				*/\n				h1{\n					/*@editable*/ font-size:24px !important;\n					/*@editable*/ line-height:100% !important;\n				}\n				/**\n				* @tab Mobile Styles\n				* @section heading 2\n				* @tip Make the second-level headings larger in size for better readability on small screens.\n				*/\n				h2{\n					/*@editable*/ font-size:20px !important;\n					/*@editable*/ line-height:100% !important;\n				}\n				/**\n				* @tab Mobile Styles\n				* @section heading 3\n				* @tip Make the third-level headings larger in size for better readability on small screens.\n				*/\n				h3{\n					/*@editable*/ font-size:18px !important;\n					/*@editable*/ line-height:100% !important;\n				}\n				/**\n				* @tab Mobile Styles\n				* @section heading 4\n				* @tip Make the fourth-level headings larger in size for better readability on small screens.\n				*/\n				h4{\n					/*@editable*/ font-size:16px !important;\n					/*@editable*/ line-height:100% !important;\n				}\n				/* ======== Header Styles ======== */\n				#templatePreheader{display:none !important;} /* Hide the template preheader to save space */\n				/**\n				* @tab Mobile Styles\n				* @section header image\n				* @tip Make the main header image fluid for portrait or landscape view adaptability, and set the image\'s original width as the max-width. If a fluid setting doesn\'t work, set the image width to half its original size instead.\n				*/\n				#headerImage{\n					height:auto !important;\n					/*@editable*/ max-width:600px !important;\n					/*@editable*/ width:100% !important;\n				}\n				/**\n				* @tab Mobile Styles\n				* @section header text\n				* @tip Make the header content text larger in size for better readability on small screens. We recommend a font size of at least 16px.\n				*/\n				.headerContent{\n					/*@editable*/ font-size:20px !important;\n					/*@editable*/ line-height:125% !important;\n				}\n				/* ======== Body Styles ======== */\n				/**\n				* @tab Mobile Styles\n				* @section body text\n				* @tip Make the body content text larger in size for better readability on small screens. We recommend a font size of at least 16px.\n				*/\n				.bodyContent{\n					/*@editable*/ font-size:18px !important;\n					/*@editable*/ line-height:125% !important;\n				}\n				/* ======== Footer Styles ======== */\n				/**\n				* @tab Mobile Styles\n				* @section footer text\n				* @tip Make the body content text larger in size for better readability on small screens.\n				*/\n				.footerContent{\n					/*@editable*/ font-size:14px !important;\n					/*@editable*/ line-height:115% !important;\n				}\n				.footerContent a{display:block !important;} /* Place footer social and utility links on their own lines, for easier access */\n			}\n		</style>\n    </head>\n    <body leftmargin=\"0\" marginwidth=\"0\" topmargin=\"0\" marginheight=\"0\" offset=\"0\">\n    	<center>\n        	<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" height=\"100%\" width=\"100%\" id=\"bodyTable\">\n            	<tr>\n                	<td align=\"center\" valign=\"top\" id=\"bodyCell\">\n                    	<!-- BEGIN TEMPLATE // -->\n                    	<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" id=\"templateContainer\">\n                        	<tr>\n                            	<td align=\"center\" valign=\"top\">\n                                	<!-- BEGIN PREHEADER // -->\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templatePreheader\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"preheaderContent\" style=\"padding-top:10px; padding-right:20px; padding-bottom:10px; padding-left:20px;\" mc:edit=\"preheader_content00\">\n                                                Confirmaci√≥n de Registro a AirLink U\n                                            </td>\n                                        </tr>\n                                    </table>\n                                    <!-- // END PREHEADER -->\n                                </td>\n                            </tr>\n                        	<tr>\n                            	<td align=\"center\" valign=\"top\">\n                                	<!-- BEGIN HEADER // -->\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateHeader\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"headerContent\">\n                                            	<img src=\"https://app.airlinku.com/public/imgs/logo-correo.png\" style=\"max-width:600px;\" id=\"headerImage\" mc:label=\"header_image\" mc:edit=\"header_image\" mc:allowdesigner mc:allowtext />\n                                            </td>\n                                        </tr>\n                                    </table>\n                                    <!-- // END HEADER -->\n                                </td>\n                            </tr>\n                        	<tr>\n                            	<td align=\"center\" valign=\"top\">\n                                	<!-- BEGIN BODY // -->\n                                    <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" id=\"templateBody\">\n                                        <tr>\n                                            <td valign=\"top\" class=\"bodyContent\" mc:edit=\"body_content\">\n                                                <h1>Bienvenido a AirLink U</h1>\n                                                <h3>Muchas gracias por registrarte</h3>\n                                                Hola {first_name},\n                                                <br />\n                                                <br />\n                                                <p>Muchas gracias por registrarte. En estos momentos tu cuenta se encuentra inactiva. \n                                                Por favor accede a la siguiente direcci√≥n para continuar tu pro