INSERT INTO `event_script` VALUES ('airlinku._table.{table_name}.{id}.delete.post_process','php',1,0,'$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n$sync->sync();\n',NULL,'2016-08-14 16:22:28','2016-08-12 03:09:59',1,1,1),('airlinku._table.{table_name}.{id}.delete.pre_process','php',1,1,'<?php\r\n\r\n$api = $platform[\'api\'];\r\n$patch = $api->patch;\r\n$get = $api->get;\r\n$logPath = \"/var/www/html/airlinku-df2/storage/logs/dreamfactoryCustom.log\";\r\n$allowSoftDelete = false;\r\n\r\n$data=[];\r\n$data[\"eliminado\"]=date(\"Y-m-d h:i:s\");\r\n$data[\"eliminado_por\"]=$platform[\"session\"][\"user\"][\"id\"];\r\n//file_put_contents($logPath, json_encode(\"Deleting....\"),FILE_APPEND );\r\n//file_put_contents($logPath, json_encode($event),FILE_APPEND );\r\n//file_put_contents($logPath, json_encode(\"Deleting....\"),FILE_APPEND );\r\n$tabla = explode(\"/\",$event[\"resource\"])[0];\r\n$entityID = explode(\"/\",$event[\"resource\"])[1];\r\n$errorStr = \"\";\r\n$separador = \"--\";\r\nswitch($tabla){\r\n	case \"caja\":\r\n		$content = $get(\"airlinku/_table/\".$event[\"resource\"])[\"content\"];\r\n		$estado = $content[\"estado\"];\r\n		if(!$estado){\r\n			$allowSoftDelete = true;\r\n		}else{\r\n			$errorStr.= $separador.\"caja_abierta\";\r\n			throw new \\Exception($errorStr);\r\n		}\r\n		break;\r\n	case \"direccion\":\r\n		/* \r\n			VERIFICAR SI LA DIRECCION SE EST√Å USANDO\r\n			VER LOS SERVICIOS PROGRAMADOS Y EN CURSO DEL USUARIO.\r\n			GET EN RESERVA. SI LA RESERVA EST√Å EN UN ESTADO DIFERENTE A NUEVA, ES PORQUE LA DIRECCI√ìN SE EST√Å USANDO\r\n		*/\r\n		$resourceReserva = $get(\"airlinku/_table/reserva?filter=(eliminado is null)and(id_direccion%3D\".$entityID.\")and(estado%3D0)\")[\"content\"][\"resource\"];\r\n		if(count($resourceReserva) === 0){\r\n			$allowSoftDelete = true;\r\n		}else{\r\n		    $errorStr.= $separador.\"direccion_en_uso\";\r\n			throw new \\Exception($errorStr);\r\n		}\r\n		break;\r\n    case \"ubicacion\":\r\n        /* \r\n			VERIFICAR SI LA UBICACION SE EST√Å USANDO            \r\n		*/\r\n\r\n		$ubicacionesEnUso = $get(\"airlinku/_table/servicio?filter=(eliminado is null)and((id_ubicacion_origen%3D\".$entityID.\")or(id_ubicacion_destino%3D\".$entityID.\"))\")[\"content\"][\"resource\"];\r\n        if(count($ubicacionesEnUso) === 0){\r\n			$allowSoftDelete = true;\r\n		}else{\r\n			$errorStr.= $separador.\"ubicacion_en_uso\";\r\n			throw new \\Exception($errorStr);\r\n		}\r\n		break;\r\n	case \"tarjetas_usuario\":\r\n	    $allowSoftDelete = false;\r\n	    break;\r\n	default:\r\n		$allowSoftDelete = true;\r\n		break;\r\n}\r\n\r\nif($allowSoftDelete){\r\n	$content = $patch(\"airlinku/_table/\".$event[\"resource\"], $data);\r\n	//header(\"Access-Control-Allow-Origin:*\");\r\n	$errorStr.= $separador.\"ok\";\r\n	throw new \\Exception($errorStr);\r\n	exit;\r\n}\r\n\r\n\r\n',NULL,'2017-07-20 15:38:45','2017-07-20 19:38:45',1,1,1),('airlinku._table.{table_name}.{id}.get.post_process','php',1,1,'$data = $event[\"response\"][\"content\"];\nif($data[\"eliminado\"] != null || $data[\"eliminado_por\"]!=null ){\n    if(!isset($event[\"request\"][\"parameters\"][\"eliminados\"])){\n        throw new \\Exception(\"Elemento no existe\");\n    }\n}\n\n// throw new \\Exception();',NULL,'2016-09-07 22:24:24','2016-09-08 03:24:24',1,1,1),('airlinku._table.{table_name}.{id}.patch.post_process','php',1,1,'//$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n//$sync->sync();\n',NULL,'2016-09-27 17:40:57','2016-09-27 22:40:57',1,1,1),('airlinku._table.{table_name}.{id}.put.post_process','php',1,1,'//$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n//$sync->sync();\n',NULL,'2016-09-27 17:41:24','2016-09-27 22:41:24',1,1,1),('airlinku._table.{table_name}.delete.post_process','php',1,0,'$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n$sync->sync();\n',NULL,'2016-08-14 16:22:28','2016-08-12 03:09:59',1,1,1),('airlinku._table.{table_name}.patch.post_process','php',1,0,'$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n$sync->sync();\n',NULL,'2016-08-14 16:22:28','2016-08-12 03:09:59',1,1,1),('airlinku._table.{table_name}.post.post_process','php',1,1,'//$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n//$sync->sync();\n',NULL,'2016-09-27 18:56:36','2016-09-27 23:56:36',1,1,1),('airlinku._table.{table_name}.put.post_process','php',1,0,'$sync=new \\TechniSupport\\DreamFactoryFirebase\\FirebaseSync($platform,$event,$payload,\"airlinku\");\n$sync->sync();\n',NULL,'2016-08-14 16:22:28','2016-08-12 03:09:59',1,1,1),('airlinku._table.caja.get.pre_process','php',0,1,' ',NULL,'2017-01-24 22:45:04','2017-01-25 03:45:04',1,1,0),('airlinku._table.conductor.{id}.put.pre_process','php',1,1,' <?php\r\n\r\n$api = $platform[\'api\'];\r\n$get = $api->get;\r\n$logPath = \"/var/www/html/airlinku-df2/storage/logs/dreamfactoryCustom.log\";\r\n//file_put_contents($logPath, json_encode(\"Editando...\"),FILE_APPEND );\r\n$requestResource = $event[\"request\"][\"payload\"];\r\n\r\n$errorStr = \"\";\r\n$separador = \"--\";\r\n\r\n$entityID = $event[\"resource\"];\r\n\r\n$nro_documento = $requestResource[\"nro_documento\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(id!%3D\".$entityID.\")and(nro_documento %3D \'\".$nro_documento.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"nro_documento\";\r\n}\r\n\r\n$email = $requestResource[\"email\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(id!%3D\".$entityID.\")and(email %3D \'\".$email.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"licencia_transito\";\r\n}\r\n\r\n$licencia_conduccion = $requestResource[\"licencia_conduccion\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(id!%3D\".$entityID.\")and(licencia_conduccion %3D \'\".$licencia_conduccion.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"licencia_conduccion\";\r\n}\r\n\r\n$fecha_nacimiento = $requestResource[\"fecha_nacimiento\"];\r\n$fecha_nacimiento = new DateTime($fecha_nacimiento);\r\n$fecha_nacimiento->modify(\"+18 year\");\r\n$now = new DateTime(\"now\");\r\n//SI FECHA DE NACIMIENTO +18 A√ëOS ES MENOR A \'AHORA\', LA PERSONA ES MAYOR DE EDAD.\r\nif($fecha_nacimiento > $now){\r\n	$errorStr.= $separador.\"fecha_nacimiento\";\r\n}\r\n\r\nif($errorStr !== \"\"){\r\n	throw new \\Exception($errorStr);\r\n}',NULL,'2017-04-27 22:12:48','2017-04-28 02:12:48',499,499,0),('airlinku._table.conductor.post.post_process','php',1,1,'$handler=new \\TechniSupport\\DreamFactory\\AuthRoles\\AuthRoles($platform,$event);',NULL,'2016-11-04 21:05:02','2016-11-05 02:05:02',1,106,1),('airlinku._table.conductor.post.pre_process','php',1,1,'<?php\r\n\r\n$api = $platform[\'api\'];\r\n$get = $api->get;\r\n$logPath = \"/var/www/html/airlinku-df2/storage/logs/dreamfactoryCustom.log\";\r\n//file_put_contents($logPath, json_encode(\"Creando vehiculo...\"),FILE_APPEND );\r\n$requestResource = $event[\"request\"][\"payload\"][\"resource\"][0];\r\n\r\n$errorStr = \"\";\r\n$separador = \"--\";\r\n\r\n$nro_documento = $requestResource[\"nro_documento\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(nro_documento %3D \'\".$nro_documento.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"nro_documento\";\r\n}\r\n\r\n$email = $requestResource[\"email\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(email %3D \'\".$email.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"licencia_transito\";\r\n}\r\n\r\n$licencia_conduccion = $requestResource[\"licencia_conduccion\"];\r\n$resource = $get(\"airlinku/_table/conductor?filter=(licencia_conduccion %3D \'\".$licencia_conduccion.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"licencia_conduccion\";\r\n}\r\n\r\n$fecha_nacimiento = $requestResource[\"fecha_nacimiento\"];\r\n$fecha_nacimiento = new DateTime($fecha_nacimiento);\r\n$fecha_nacimiento->modify(\"+18 year\");\r\n$now = new DateTime(\"now\");\r\n//SI FECHA DE NACIMIENTO +18 A√ëOS ES MENOR A \'AHORA\', LA PERSONA ES MAYOR DE EDAD.\r\nif($fecha_nacimiento > $now){\r\n	$errorStr.= $separador.\"fecha_nacimiento\";\r\n}\r\n\r\nif($errorStr !== \"\"){\r\n	throw new \\Exception($errorStr);\r\n}\r\n\r\n$handler=new \\TechniSupport\\DreamFactory\\AuthRoles\\AuthRoles($platform,$event);',NULL,'2017-04-26 22:15:29','2017-04-27 02:15:29',106,499,1),('airlinku._table.dreamfactory.user.{id}.get.post_process','php',0,1,'if(isset($respones[\"resource\"])){\n    $resources = [];\n    $data = $response[\"resource\"];\n    \n    foreach($data as $datum){\n        if(isset($datum[\"password\"])){\n            unset($datum[\"password\"]);\n        }\n        $resources[]=$datum;\n    }\n    \n    $response[\"resource\"] = $resources;\n}\n\nif(isset($response[\"password\"]){\n     unset($response[\"password\"]);\n}\n\n\nerror_log(var_export($response,true));\n\n',NULL,'2016-09-02 14:10:09','2016-09-02 19:10:09',1,1,0),('airlinku._table.dreamfactory.user.get.post_process','php',1,1,'$resources = [];\n$data = $event[\"response\"][\"content\"][\"resource\"];\n\nforeach($data as $datum){\n    $resource=[];\n    foreach($datum as $key=>$field){\n        if(in_array($key,[\"id\",\"first_name\",\"last_name\",\"email\"])){\n            $resource[$key]=$field;\n        }\n    }\n    \n    $resources[]=$resource;\n}\n\n$event[\"response\"][\"content\"][\"resource\"] = $resources;\n\nerror_log(var_export($event,true));\n',NULL,'2016-09-02 14:28:49','2016-09-02 19:28:49',1,1,1),('airlinku._table.empresa.{id}.put.pre_process','php',1,1,'<?php\r\n\r\n$api = $platform[\'api\'];\r\n$get = $api->get;\r\n$logPath = \"/var/www/html/airlinku-df2/storage/logs/dreamfactoryCustom.log\";\r\n//file_put_contents($logPath, json_encode(\"Editando...\"),FILE_APPEND );\r\n$requestResource = $event[\"request\"][\"payload\"];\r\n\r\n$errorStr = \"\";\r\n$separador = \"--\";\r\n\r\n$entityID = $event[\"resource\"];\r\n$nro_documento = $requestResource[\"nro_documento\"];\r\n$resource = $get(\"airlinku/_table/empresa?filter=(id!%3D\".$entityID.\")and(nro_documento %3D \'\".$nro_documento.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nfile_put_contents($logPath, json_encode($resource),FILE_APPEND );\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"nro_documento\";\r\n}\r\n\r\nif($errorStr !== \"\"){\r\n	throw new \\Exception($errorStr);\r\n}',NULL,'2017-04-27 20:04:09','2017-04-28 00:04:09',499,499,0),('airlinku._table.empresa.post.pre_process','php',1,1,'<?php\r\n\r\n$api = $platform[\'api\'];\r\n$get = $api->get;\r\n$logPath = storage_path().\"/logs/dreamfactoryCustom.log\";\r\n//file_put_contents($logPath, json_encode(\"Creando empresa...\"),FILE_APPEND );\r\n$requestResource = $event[\"request\"][\"payload\"][\"resource\"][0];\r\n\r\n$errorStr = \"\";\r\n$separador = \"--\";\r\n\r\n$nro_documento = $requestResource[\"nro_documento\"];\r\n$resource = $get(\"airlinku/_table/empresa?filter=(nro_documento %3D \'\".$nro_documento.\"\')and(eliminado is null)\")[\"content\"][\"resource\"];\r\nif(count($resource)>0){\r\n	$errorStr.= $separador.\"nro_documento\";\r\n}\r\n\r\nif($errorStr !== \"\"){\r\n	throw new \\Exception($errorStr);\r\n}',NULL,'2017-12-05 22:41:03','2017-12-05 22:41:03',499,499,0),('airlinku._table.movimiento.post.post_process','php',1,1,'<?php\r\n$logURL = \"/var/www/html/airlinku-df2/storage/logs/dreamfactoryCustom.log\";\r\n// file_put_contents($logURL, json_encode($paramsEmail),FILE_APPEND );\r\n$post =  $platform[\"api\"]->post;\r\n$get =  $platform[\"api\"]->get;\r\n$payload=$event[\"request\"][\"payload\"][\"resource\"][0];\r\n$respuesta=$event[\"response\"][\"content\"][\"resource\"][0];\r\nif(isset($respuesta[\"id\"]) && $respuesta[\"id\"]*1>0){\r\n    if($payload[\"id_tipo_movimiento\"]*1===1){\r\n        setlocale(LC_MONETARY, \'es_CO\');\r\n        $id_usuario = $payload[\"id_usuario\"];\r\n        $content=$get(\"airlinku/_table/usuario/\".$id_usuario);\r\n        $valor=money_format(\'%i\', $payload[\"valor\"]);\r\n        $mensaje = \"Gracias por utilizar AirLink U. \\nTu recarga fue exitosa. \\nValor de la Recarga: $valor\\n\\n\";\r\n        /*AQU√ç SE ENV√çA EL MENSAJE DE TEXTO PARA CONFIRMAR LA RECARGA DE SALDO*/\r\n        if(isset($content[\"content\"]) && isset($content[\"content\"][\"telefono\"]) ) {\r\n            $telefono=$content[\"content\"][\"telefono\"];\r\n            if(strlen($telefono)>=10){\r\n                if(strlen($telefono)>10){\r\n                    $telefono = substr($telefono,strlen($telefono)-10-1,10);\r\n                }\r\n                $params=[\"numero\"=>$telefono,\"mensaje\"=>$mensaje];\r\n                $salida=$post(\"sms/mensaje?numero=$telefono&mensaje=\".urlencode($mensaje),$params);\r\n            }\r\n        }\r\n        /*AQU√ç SE ENV√çA EL EMAIL PARA CONFIRMAR LA RECARGA DE SALDO*/\r\n        $paramsEmail=[\r\n            \"to\" => [\r\n                [\r\n                \"name\" => $content[\"content\"][\"primer_nombre\"],\r\n                \"email\" => $content[\"content\"][\"user\"][\"email\"]\r\n                ]\r\n            ],\r\n            \"first_name\" => $content[\"content\"][\"primer_nombre\"],\r\n            \"valor_recarga\" => \"\".$valor.\"\"\r\n        ];\r\n        $salidaEmail=$post(\"email?template=AirlinkU_Notificar_Recarga\",$paramsEmail);\r\n    }\r\n}',NULL,'2017-10-03 22:23:17','2017-10-03 21:23:17',1,499,1),('airlinku._table.reserva.{id}.patch.post_p