			}\n			}\n		}\n	}\n}','2016-09-22 16:14:50','2016-09-22 21:14:50'),(11,24,0,'{\n	\"swagger\": \"2.0\",\n	\"info\": {\n		\"version\": \"0.1.0\",\n		\"title\": \"Airlink U Funciones de Usuario\"\n	},\n	\"paths\": {\n		\"/reportes\": {\n			\"get\": {\n				\"description\": \"Get obtiene los recursos de usuarios dados por el parametro tipo\\n\",\n				\"parameters\": [\n					{\n						\"name\": \"tipo\",\n						\"in\": \"query\",\n						\"description\": \"Tipo de reporte\",\n						\"required\": true,\n						\"type\": \"string\"\n					}\n				],\n				\"responses\": {\n					\"200\": {\n						\"description\": \"Successful response\",\n						\"schema\": {\n							\"type\": \"object\"\n						}\n					}\n				}\n			}\n		}\n	}\n}','2016-10-04 16:01:26','2016-10-04 21:01:26'),(15,28,0,'{\n	\"swagger\": \"2.0\",\n	\"info\": {\n		\"version\": \"0.1.0\",\n		\"title\": \"Airlink U Env√≠o de SMS\"\n	},\n	\"paths\": {\n		\"/mensaje\": {\n			\"post\": {\n				\"description\": \"Env√≠a SMS\\n\",\n				\"parameters\": [\n					{\n						\"name\": \"numero\",\n						\"in\": \"query\",\n						\"description\": \"n√∫mero de telefono\",\n						\"required\": true,\n						\"type\": \"string\"\n					},\n					{\n						\"name\": \"mensaje\",\n						\"in\": \"query\",\n						\"description\": \"cuerpo del mensaje \",\n						\"required\": true,\n						\"type\": \"string\"\n					}\n				],\n				\"responses\": {\n					\"200\": {\n						\"description\": \"Successful response\",\n						\"schema\": {\n							\"type\": \"object\"\n						}\n					}\n				}\n			}\n		}\n	}\n}','2016-11-05 19:10:47','2016-11-06 00:10:47'),(16,30,0,'{\n	\"paths\": {},\n	\"definitions\": {}\n}','2017-02-08 19:16:24','2017-02-08 19:16:24'),(17,31,0,'{\n	\"paths\": {},\n	\"definitions\": {}\n}','2017-07-11 20:34:17','2017-07-11 20:34:17'),(18,32,0,'{\n	\"paths\": {},\n	\"definitions\": {}\n}','2017-07-27 19:48:02','2017-07-27 19:48:02'),(19,33,0,'{\n	\"paths\": {},\n	\"definitions\": {}\n}','2017-07-31 13:32:45','2017-07-31 13:32:45'),(20,3